import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import dummyDate from './static/dummyData';


class Sidebar extends React.Component {
    constructor(props){
        super(props);
        this.state = {
            data: dummyDate
        }
    }

    render() {
        return (
            <React.Fragment>
                <p>{this.state.data.map(el => <p key={el.id}><div>{el.title}</div></p>)}</p>
            </React.Fragment >
        )
    }
}

export default Sidebar
